import { useEffect, useState } from "react";
import axios from "axios";

export default function Profile() {
  const [data, setData] = useState({});

  useEffect(() => {
    const email = localStorage.getItem("email"); // get logged-in email
    axios.get(`http://127.0.0.1:8000/api/myprofile/?email=${email}`)
      .then(res => setData(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div className="max-w-2xl mx-auto bg-white p-6 rounded shadow-md">
      <h2 className="text-2xl font-bold mb-4">My Profile</h2>
      <table className="table-auto w-full text-left border">
        <tbody>
          <tr className="border-b">
            <th className="px-2 py-1">Name</th><td className="px-2 py-1">{data.name}</td>
          </tr>
          <tr className="border-b">
            <th className="px-2 py-1">Email</th><td className="px-2 py-1">{data.email}</td>
          </tr>
          <tr className="border-b">
            <th className="px-2 py-1">Department</th><td className="px-2 py-1">{data.department}</td>
          </tr>
          <tr className="border-b">
            <th className="px-2 py-1">Created At</th><td className="px-2 py-1">{data.created_at}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
